import { useAuth } from "../lib/auth2";
import React, { useState } from "react";
import { Form, FormGroup, Label, Input, Col } from "reactstrap";

export default function Profile() {
  const { user } = useAuth();

  return (
    <Form>
      <FormGroup row>
        <Label
          for='exampleEmail'
          sm={2}>
          Email
        </Label>
        <Col sm={10}>
          <Input
            name='email'
            placeholder={user.email}
            type='email'
          />
        </Col>
      </FormGroup>
      <FormGroup row>
        <Label
          for='username'
          sm={2}>
          Email
        </Label>
        <Col sm={10}>
          <Input
            name='username'
            placeholder={user.username}
            type='username'
          />
        </Col>
      </FormGroup>
    </Form>
  );
}

